          Information only for providing and improving the app. By using the
          Site, you agree to the collection and use of information in accordance
          with this policy.
        </p>
      </div>
      <style jsx>{`
        .wrapper {
          display: flex;
          flex-direction: column;
          margin-top: 150px;
        }
      `}</style>
    </div>
  );
}

Privacy.Layout = DashboardLayout;

export default Privacy;
